function ADVINION_Internal_GenrateFlashVars(objADVInit)
{
    var strKey;
    var strVARS="";
    
    for (strKey in objADVInit)
    {
        if (strKey!=null && objADVInit[strKey]!=null)
        {
            if (strVARS.length==0)
                strVARS=strKey+"="+objADVInit[strKey];
            else
